import React, { useState } from 'react';
import { Link } from 'react-router-dom';
import { useAuth } from '../contexts/AuthContext';

const Header = () => {
  const { user, logout } = useAuth();
  const [isJobsOpen, setIsJobsOpen] = useState(false);
  const [isCustomersOpen, setIsCustomersOpen] = useState(false);
  const [isRoutesOpen, setIsRoutesOpen] = useState(false);
  const [isEmployeesOpen, setIsEmployeesOpen] = useState(false);
  const [isToolsOpen, setIsToolsOpen] = useState(false);

  return (
    <nav className="bg-surface">
      <div className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8">
        <div className="flex items-center justify-between h-16">
          <div className="flex items-center">
            <Link to="/dashboard" className="font-bold text-xl text-white">AUTOLAWN</Link>
          </div>
          <div className="flex items-center space-x-4">
            <Link to="/dashboard" className="text-white px-3 py-2 rounded-md text-sm font-medium">Dashboard</Link>

            {/* Jobs Dropdown */}
            <div className="relative">
              <button
                onClick={() => setIsJobsOpen(!isJobsOpen)}
                className="text-white px-3 py-2 rounded-md text-sm font-medium focus:outline-none"
              >
                Jobs
              </button>
              {isJobsOpen && (
                <div className="absolute mt-2 w-48 bg-white rounded-md shadow-lg z-10">
                  <Link to="/jobs" className="block px-4 py-2 text-gray-800 hover:bg-gray-100">Create Job</Link>
                  <Link to="/manage-jobs" className="block px-4 py-2 text-gray-800 hover:bg-gray-100">Manage Jobs</Link>
                </div>
              )}
            </div>

            {/* Customers Dropdown */}
            <div className="relative">
              <button
                onClick={() => setIsCustomersOpen(!isCustomersOpen)}
                className="text-white px-3 py-2 rounded-md text-sm font-medium focus:outline-none"
              >
                Customers
              </button>
              {isCustomersOpen && (
                <div className="absolute mt-2 w-48 bg-white rounded-md shadow-lg z-10">
                  <Link to="/customers" className="block px-4 py-2 text-gray-800 hover:bg-gray-100">Create Customer</Link>
                  <Link to="/manage-customers" className="block px-4 py-2 text-gray-800 hover:bg-gray-100">Manage Customers</Link>
                </div>
              )}
            </div>

            {/* Routes Dropdown */}
            <div className="relative">
              <button
                onClick={() => setIsRoutesOpen(!isRoutesOpen)}
                className="text-white px-3 py-2 rounded-md text-sm font-medium focus:outline-none"
              >
                Routes
              </button>
              {isRoutesOpen && (
                <div className="absolute mt-2 w-48 bg-white rounded-md shadow-lg z-10">
                  <Link to="/build-routes" className="block px-4 py-2 text-gray-800 hover:bg-gray-100">Route Builder</Link>
                </div>
              )}
            </div>

            {/* Employees Dropdown */}
            <div className="relative">
              <button
                onClick={() => setIsEmployeesOpen(!isEmployeesOpen)}
                className="text-white px-3 py-2 rounded-md text-sm font-medium focus:outline-none"
              >
                Employees
              </button>
              {isEmployeesOpen && (
                <div className="absolute mt-2 w-48 bg-white rounded-md shadow-lg z-10">
                  <Link to="/add-employee" className="block px-4 py-2 text-gray-800 hover:bg-gray-100">Create Employee</Link>
                  <Link to="/manage-employees" className="block px-4 py-2 text-gray-800 hover:bg-gray-100">Manage Employees</Link>
                </div>
              )}
            </div>

            {/* Tools Dropdown */}
            <div className="relative">
              <button
                onClick={() => setIsToolsOpen(!isToolsOpen)}
                className="text-white px-3 py-2 rounded-md text-sm font-medium focus:outline-none"
              >
                Tools
              </button>
              {isToolsOpen && (
                <div className="absolute mt-2 w-48 bg-white rounded-md shadow-lg z-10">
                  <Link to="/quote-tool" className="block px-4 py-2 text-gray-800 hover:bg-gray-100">Quoting Tool</Link>
                  <Link to="/generate-report" className="block px-4 py-2 text-gray-800 hover:bg-gray-100">Generate Report</Link>
                </div>
              )}
            </div>

            {/* Profile */}
            <Link to="/profile" className="text-white px-3 py-2 rounded-md text-sm font-medium">Profile</Link>

            {/* Logout Button */}
            <button
              onClick={logout}
              className="ml-4 bg-rose-700 text-white px-4 py-2 rounded-md text-sm font-medium hover:bg-opacity-90"
            >
              Logout
            </button>
          </div>
        </div>
      </div>
    </nav>
  );
};

export default Header;
